import './css/flexbox.css';
import './css/mediaquery.css';

function App(){
  return(
    <header>
        <nav class="container-nav">
            <h1>Portfólio</h1>
            <ul>
                <li class="nav-items"><a href="#aboutMe">Sobre mim</a></li>
                <li class="nav-items"><a href="#projects">Projetos</a></li>
                <li class="nav-items"><a href="#services">Serviços</a></li>
                <li class="nav-items"><a href="#skills">Minhas Skills</a></li>
            </ul>
            <i class="bi bi-list menu-icon" id="menu-icon-btn"></i>
        </nav>
    </header>
  )
}

export default App;
